import React from "react";
import InputFields from "../../../../Components/InputField/index";
import styles from "./forms.modules.css"
const Forms = () => {
  return (
    <div style={{backgroundColor}}>
      <div className={styles.text}>
        <p className={styles.subDiv}>
          Welcome to <span style={styles.subText}>OrPak</span>
        </p>
      </div>
      <div className={styles.input}>
        <InputFields type={"text"} placeholder={"User name"} />
        <InputFields type={"password"} placeholder={"password"} />
      </div>
    </div>
  );
};

export default Forms;
